package com.kuaixiu.sjBusiness.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-05-13 下午12:42:33 * @version: V 1.0 */public class ApprovalNote extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private Long id ;    /**     * 订单编号     */    private String orderNo ;    /**     * 备注     */    private String note ;    /**     * 创建时间     */    private java.util.Date createTime ;    public Long getId(){        return this.id;    }    public void setId(Long id){        this.id=id;    }    public String getOrderNo(){        return this.orderNo;    }    public void setOrderNo(String orderNo){        this.orderNo=orderNo;    }    public String getNote(){        return this.note;    }    public void setNote(String note){        this.note=note;    }    public java.util.Date getCreateTime(){        return this.createTime;    }    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }}